selector_to_html = {"a[href=\"#zenons-paradoks\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11.1.1. </span>Zenons paradoks<a class=\"headerlink\" href=\"#zenons-paradoks\" title=\"Permalink til denne overskrift\">#</a></h2><p>Oldtidens kulturer havde forskellige id\u00e9er om, hvad uendelighedsbegrebet d\u00e6kkede over. Dengang betragtede man begrebet med en mere filosofisk tilgang. Den f\u00f8rste matematiske opfattelse af uendelighedsbegrebet kom fra den gr\u00e6ske filosof og matematiker Zenon, der er kendt for sine tankeeksperimenter. Is\u00e6r er han kendt for tankeeksperimentet \u201cAchilleus og skildpadden\u201d. Det var egentlig ikke var meningen at komme med en pointe omkring uendelig, men eksperimentet er alligevel god til at illustrere det abstrakte ved et uendelighedsbegreb.</p><p>Eksperimentet best\u00e5r af to deltagere Achilleus og en skildpadde, der skal l\u00f8be mod hinanden. Men for at det bliver et fair race, s\u00e5 f\u00e5r skildpadden 100 m forspring. Dern\u00e6st forl\u00f8ber racet som f\u00f8lger</p>", "a[href=\"#uendelighed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11.1.2. </span>Uendelighed<a class=\"headerlink\" href=\"#uendelighed\" title=\"Permalink til denne overskrift\">#</a></h2><p>Der findes ikke en unik st\u00f8rrelse, der kan till\u00e6gges uendelig. Forskelligere anskuelser leder til forskellige definitioner af, hvad uendelig er.</p><p>Den uendelighed, som vi kommer til at besk\u00e6ftige os med, er det \u201ctal\u201d, som vores tallinje ender ved,\ngr\u00e6nsen. Vores tallinje g\u00e5r fra -infty til +infty. Men, infty er ikke et tal i klassisk forstand. For os er det mere et begreb. Derfor giver det ikke mening at bruge infty som et hvilket som helst tal. Vi kan fx ikke skrive <span class=\"math notranslate nohighlight\">\\(2+\\infty\\)</span> eller <span class=\"math notranslate nohighlight\">\\(\\infty-\\infty\\)</span>. Vi kan heller ikke skrive <span class=\"math notranslate nohighlight\">\\(f(\\infty)\\)</span>. Det er her, hvor gr\u00e6nsev\u00e6rdibegrebet bliver anvendeligt og det vil vi introducere i de kommende kapitler.</p>", "a[href=\"#uendelighedsbegrebet\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11.1. </span>Uendelighedsbegrebet<a class=\"headerlink\" href=\"#uendelighedsbegrebet\" title=\"Permalink til denne overskrift\">#</a></h1><p>Du har helt sikkert h\u00f8rt om \u201cuendelighed\u201d p\u00e5 et eller andet tidspunkt. Men hvordan definerer vi det matematisk? Og hvordan bruger vi det i matematikken?</p><p>I dag har vi udviklet en masse teori, der g\u00f8r uendelighedsbegrebet i mange henseender anvendeligt og differentialregningen er blot en af dem.</p>", "a[href=\"#forskellige-storrelser-uendelig\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11.1.3. </span>Forskellige st\u00f8rrelser uendelig<a class=\"headerlink\" href=\"#forskellige-storrelser-uendelig\" title=\"Permalink til denne overskrift\">#</a></h2><p>Snakker vi uendelighed i m\u00e6mgdeteorien, s\u00e5 er det muligt at snakke om st\u00f8rrelsesordenen p\u00e5 uendelighederne.</p><p>T\u00e6ller vi antallet af elementer i de naturlige tal, <span class=\"math notranslate nohighlight\">\\(\\mathbb{N}\\)</span>, s\u00e5 f\u00e5r vi uendeligheden, der betegnes <span class=\"math notranslate nohighlight\">\\(\\aleph_0\\)</span> og udtales <em>aleph-0</em>. Husker vi tilbage til kapitlet om m\u00e6ngdeteori, s\u00e5 kalder vi den funktion, der t\u00e6ller antallet af elementer i en m\u00e6ngde for \u00bbkardinaliteten\u00ab. Vi skriver</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
